import React from 'react';
import Navbar from '../../Components/Navbar/Navbar';
import NewsLetter from '../../Components/Layouts/NewsLetter';
import Footer from '../../Components/Layouts/Footer';
 function News(){
     return(
         <div>
             <Navbar/>
             <NewsLetter/>
             <Footer/>
         </div>
     )
 }
 export default News;
